// Services.js

import React from 'react';
import { Link } from 'react-router-dom'
import '../style/Service.css';

const Services = () => {
  const buttonsText = [<Link  to={'/services/regularmaintenance'}>Regular Maintenance</Link>,
  <Link  to={'/services/repairs'}>Repairs</Link>,
  <Link  to={'/services/customization'}>Customization Services</Link>,
  <Link  to={'/services/upgrades'}>Upgrades and Installations</Link>,
  <Link  to={'/services/cleaning'}>Cleaning and Detailing</Link>,
  <Link  to={'/services/safety'}>Safety Check and Inspection</Link>,
  <Link  to={'/services/pickup'}>Pickup</Link>,
  <Link  to={'/services/emergency'}>Emergency Services</Link>
  ];

   const logos = [
    '/images/services/regularmaintenance.jpg',
    '/images/services/repairs.jpg',
    '/images/services/customizationservices.png',
    '/images/services/upgradesandinstallations.jpg',
    '/images/services/cleaninganddetailing.jpg',
    '/images/services/safetycheck.jpg',
    '/images/services/pickupanddelivery.jpg',
    '/images/services/emergency.png',
  ];

  return (
    <div className="services-container">
      {buttonsText.map((text, index) => (
        <div key={index} className="service-item">
            <div className='image'><img src={logos[index]} alt={`Logo ${index + 1}`} />
            <button className="custom-button">{text}</button>
            </div>
        </div>
      ))}
    </div>
  );
};

export default Services;
